import Link from "next/link";

const Navbar = () => (
    <nav className="navbar navbar-expand-md navbar-light bg-light">
        <a href="#" className="navbar-brand">Brand</a>
        <button type="button" className="navbar-toggler"></button>
    </nav>
);

export default Navbar;
